function App() {
  const expenses=[
    {
      id:1,
      title:"Car Insurance",
      date:new Date(2021, 28, 2),
      price:"290.4"
    }
  ];
  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} date={expenses[0].date} price={expenses[0].price} ></ExpenseItem>

    </div>
  );
}

export default App;
